import React from 'react';
import { NavLink } from 'react-router-dom';
import s from './Dialogs.module.css';

const DialogItem = () => {
    return (
        <div className={s.dialog}>
            <NavLink to='./dialogs/1'> Hanna </NavLink>
        </div>
    )
}

const Dialogs = (props) => {
    return (
        <div className={s.dialogs}>
            <div className={s.dialogsItems}>
                <DialogItem />
                <div className={s.dialog}>
                <NavLink to='./dialogs/2'> Nikolay </NavLink>
                </div>
                <div className={s.dialog + ' ' + s.active}>
                <NavLink to='./dialogs/3'>  Andrey </NavLink>
                </div>
                <div className={s.dialog}>
                <NavLink to='./dialogs/4'>  Anastaysha </NavLink>
                </div>
                <div className={s.dialog}>
                <NavLink to='./dialogs/5'>  Alex </NavLink>
                </div>
            </div>
            <div className={s.messages}>
                <div className={s.message}>Hi! How are you?</div>
                <div className={s.message}> How is your job? Finished the redesign?</div>
                <div className={s.message}>Maybe we will meet in the evening?</div>
            </div>
        </div>
    )
}

export default Dialogs;
